import React from "react";
import { useRouter } from "next/router";

export const Details = ({}) => {
  const router = useRouter();

  return (
    <>
      <div className="spacer" />
      <h1>Trash Can: {router.query.id}</h1>
      <style jsx>{`
        .spacer {
          flex: 1;
        }
      `}</style>
    </>
  );
};

export default Details;
